    return (
        <div className="container">
             <div className="col">
                    <Breadcrumb>
                        <BreadcrumbItem><Link to="/home">Home</Link></BreadcrumbItem>
                        <BreadcrumbItem active>Create Account</BreadcrumbItem>
                    </Breadcrumb>
                    <h2>Create Account</h2>
            </div> 
            <div className="row">
                    {Acccount}
                </div>       
        </div>

    );
}




export default Account;
